import React from 'react';
import axios from 'axios';

function getData(config, url){
    axios.get(url, config)
    .then(res => {
        return res;
    //   if(callback != null){
        //  callback(res);
    //   }
    })
    .catch(err => {
        return err;
    //   if(errorcallback != null){
    //      errorcallback(err);
    //      console.log(err, "check log");
    //   }
    })
}

export default getData;
